//         if (!isOpen) {
//             slideInDiv.style.animation = "slideIn 1s forwards";
//         } else {
//             slideInDiv.style.animation = "slideOut 1s forwards";
//         }

//         isOpen = !isOpen;
//     });
// });

  return (
    <header className="bg-blue-900 text-white">
      <div className="mx-5 flex items-center justify-between">
        <Link to="/">
          <img className="w-16 md:w-24 lg:w-32 rounded-full" src={image} alt="LOGO" />
        </Link>
        <p className='lg:text-3xl md:text-lg'>Tahar Garage Door Repair Services</p>



          <div className="md:flex justify-between py-4 text-center">
        <a
          className="mb-2 md:my-0 bg-red-600 hover:bg-green-600 text-white py-2 px-4 rounded-full inline-block"
          href="tel:661-202-8255"
        >
          Call Now For A Free Quote! 661-202-8255
        </a>
      </div>
      </div>

      {/* Show the mobile menu on screens the size of a mobile device */}
      {isMobileMenuOpen && (
        <div className="absolute bg-blue-400 container mx-auto py-4 text-center custom-menu-slide">
          <ul className="space-y-2">
            <li>
              <Link
                className="hover:text-blue-300"
                to="/about"
                onClick={toggleMobileMenu}
              >
                About Us
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/reviews"
                onClick={toggleMobileMenu}
              >
                Reviews
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/services"
                onClick={toggleMobileMenu}
              >
                Services
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/gallery"
                onClick={toggleMobileMenu}
              >
                Gallery
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/faq"
                onClick={toggleMobileMenu}
              >
                FAQ
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/contact"
                onClick={toggleMobileMenu}
              >
                Contact
              </Link>
            </li>
          </ul>
        </div>
      )}

<nav className="hidden md:block space-x-4 text-center">
            <Link className="hover:text-blue-300 hover:mb-12" to="/about">
              About Us
            </Link>
            <Link className="hover:text-blue-300" to="/reviews">
              Reviews
            </Link>
            <Link className="hover:text-blue-300" to="/services">
              Services
            </Link>
            <Link className="hover:text-blue-300" to="/gallery">
              Gallery
            </Link>
            <Link className="hover:text-blue-300" to="/faq">
              FAQ
            </Link>
            <Link className="hover:text-blue-300" to="/contact">
              Contact
            </Link>
          </nav>



    </header>
  );
};

export default Header;
